import React from 'react';

function About() {
	return (
		<section>
			<div className="center" id="about">
				<h1 className="page-header">About Malick Ba</h1>
			</div>
			<div>
				<p>
                Thank you for visiting my portfolio. I am a Certified Full Stack Developer based in Arlington, Virginia. While my work in tech focuses on the Front End, 
                I do possess a good working knowledge of the Back End. Previously, I worked in International Security sector in the Washington, DC area and gained a solid experience in Project Management, 
                which provides a unique perspective when working in development teams using Agile methodology. 
                I love solving problems, debugging, troubleshooting, designing and implementing solutions to complex issues. I speak four languages fluently, including French. My hobbies include cinema, soccer, and camping. If you have any questions, do not hesitate to send me a message. I would be happy to hear from you.
				</p>
			</div>
		</section>
	);
}

export default About;
